export const fetchCustomerData = async (phoneNumber: string): Promise<CustomerData | null> => {
  // 模拟加载效果
  await new Promise(resolve => setTimeout(resolve, 800));
  
  // 查找匹配的手机号
  const record = RAW_DATA.find(item => String(item.phoneNumber).trim() === phoneNumber.trim());
  
  if (!record) return null;

  // 辅助函数：将 Excel 的各种空值转换为 0
  const n = (val: any) => {
    if (!val || val === "" || val === null) return 0;
    return parseInt(val);
  };

  // 转换数据结构以适配 UI
  const structuredData: CustomerData = {
    phoneNumber: String(record.phoneNumber),
    name: record.name || '库迪好友',
    firstOrderDate: record.firstOrderDate || '',
    firstOrderItem: record.firstOrderItem || '',
    favoriteItem: record.favoriteItem || '',
    favoriteItemCount: n(record.favoriteItemCount),
    preferenceDepth: record.preferenceDepth || '0%',
    favoriteItemRank: n(record.favoriteItemRank),
    topUserCount: n(record.topUserCount),
    totalCups: n(record.totalCups),
    totalCupsRank: n(record.totalCupsRank),
    totalCupsTitle: record.totalCupsTitle || '',
    distinctItemsCount: n(record.distinctItemsCount),
    explorationProgress: record.explorationProgress || '0/91',
    explorationTitle: record.explorationTitle || '',
    explorationRank: n(record.explorationRank),
    
    // 勋章处理：支持 itemTitles 逗号分隔列，或者 勋章1, 勋章2... 这种列名
    itemTitles: record.itemTitles 
      ? record.itemTitles.split(',').filter((t: string) => t.trim() !== '')
      : [record.勋章1, record.勋章2, record.勋章3, record.勋章4, record.勋章5].filter(Boolean),

    // 自动组合每月数据
    monthlyCounts: [
      n(record.m1), n(record.m2), n(record.m3), n(record.m4), 
      n(record.m5), n(record.m6), n(record.m7), n(record.m8), 
      n(record.m9), n(record.m10), n(record.m11), n(record.m12), n(record.m13)
    ],

    // 自动组合分类数据
    categoryCounts: {
      classicCoffee: n(record.classicCoffee),
      flavorLatte: n(record.flavorLatte),
      fruitCoffee: n(record.fruitCoffee),
      caffeineFree: n(record.caffeineFree),
      milkTea: n(record.milkTea),
      fruitTea: n(record.fruitTea),
    },
    orders: [] // 历史订单列表暂时留空，已通过汇总数据展示
  };

  return structuredData;
};